    data: |
      SELECT DISTINCT - col2 * - ( ( - col0 - ( 95 ) - - cor0.col1 - - col2 ) ) + + col0 + + col1 AS col2 FROM tab0 (FORMAT parquet) cor0;
  - name: tab0

outputs:
  - name: q6033.out
    data: |
      -722
      100
      110
